def get_analytics(result):
    df = pd.DataFrame(result, columns=['SUBJECT', 'TOTAL (100%)'])

    # Display the result
    st.write(df)

    analyze_button = st.button("Get Analysis")
    if analyze_button:
        global sorted_data
        sorted_data = df[['SUBJECT', 'TOTAL (100%)']].sort_values(by='TOTAL (100%)', ascending=True)
        st.session_state['sorted_data'] = sorted_data

        # Normalize the total scores to a 0-1 range
        norm = mcolors.Normalize(vmin=0, vmax=100)  # score range is from 0 to 100
        cmap = plt.cm.RdYlGn

        # Map the normalized total scores to the colormap
        bar_colors = cmap(norm(sorted_data['TOTAL (100%)']))

        # Plot a bar chart
        fig, ax = plt.subplots(figsize=(10, 6))
        ax.bar(sorted_data['SUBJECT'], sorted_data['TOTAL (100%)'], color=bar_colors)

        # Add labels and title
        ax.set_xlabel('SUBJECT')
        ax.set_ylabel('TOTAL (100%)')
        ax.set_title('Scores by Subject (Sorted)')
        plt.ylim(0, sorted_data['TOTAL (100%)'].max() * 1.1)  # Scale down/up as needed
        plt.xticks(rotation=45, ha='right')

        # Display the chart in Streamlit
        st.pyplot(fig)

      
      
      



def get_study_guide():
    #Create analyze button
  study_plan_button = st.button("Create Study Plan")


  # Check if the button is clicked and sorted_data is available
  if study_plan_button and 'sorted_data' in st.session_state:
      sorted_data = st.session_state['sorted_data']
      # create study plan
      # Assuming 'sorted_data' DataFrame has the calculated 'study_hours' per subject
      # Step 1: Identify the lowest 3 subjects based on performance (sorted ascending)
      lowest_3_subjects = sorted_data.head(3).copy()  # .copy() to avoid view warning

      # Step 2: Assign 3 hours to each of the lowest 3 subjects
      lowest_3_subjects.loc[:, 'study_hours'] = 3  # Use .loc for assignment

      # Step 3: Calculate remaining hours
      total_study_hours = 18  # 2 hours/day on weekdays, 4 hours/day on weekends (total 18 hours)
      hours_assigned_to_lowest = lowest_3_subjects['study_hours'].sum()
      remaining_hours = total_study_hours - hours_assigned_to_lowest  # 18 - 9 = 9 hours left

      # Step 4: Distribute remaining hours among other subjects
      other_subjects = sorted_data.iloc[3:].copy()  # .copy() to avoid view warning
      num_other_subjects = len(other_subjects)

      # Assign even time to the other subjects
      other_subjects.loc[:, 'study_hours'] = remaining_hours / num_other_subjects

      # Step 5: Round up study hours to the nearest whole number
      other_subjects.loc[:, 'study_hours'] = other_subjects['study_hours'].apply(math.ceil)

      # Step 6: Combine the dataframes back together
      final_subjects = pd.concat([lowest_3_subjects, other_subjects]).reset_index(drop=True)

      # Prepare the daily timetable
      days = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday']
      daily_study_limit = {'Monday': 2, 'Tuesday': 2, 'Wednesday': 2, 'Thursday': 2, 'Friday': 2, 'Saturday': 4, 'Sunday': 4}

      # Initialize empty timetable
      timetable = {day: [] for day in days}

      # Sort by updated study hours (descending to prioritize more study time first)
      subjects_sorted = final_subjects.sort_values(by='study_hours', ascending=False).reset_index(drop=True)

      # Step 7: Allocate study hours to the timetable
      remaining_study_hours = subjects_sorted[['SUBJECT', 'study_hours']].copy()

      # Keep track of the last subject scheduled each day
      last_scheduled_subject = None

      for day in days:
          remaining_limit = daily_study_limit[day]
          i = 0
          
          while remaining_limit > 0 and i < len(remaining_study_hours):
              subject = remaining_study_hours.loc[i, 'SUBJECT']
              study_hours_left = remaining_study_hours.loc[i, 'study_hours']
              
              # Ensure the subject doesn't appear on consecutive days
              if subject == last_scheduled_subject:
                  i += 1
                  continue
              
              # Assign up to the remaining limit of the day or whatever is left of the subject's study hours
              assigned_hours = min(study_hours_left, remaining_limit)

              # Add to timetable for the day
              timetable[day].append((subject, assigned_hours))

              # Update the remaining hours for the subject and the day
              remaining_study_hours.loc[i, 'study_hours'] -= assigned_hours
              remaining_limit -= assigned_hours

              # Set this subject as the last scheduled for this day
              last_scheduled_subject = subject

              # If all study hours for the subject have been assigned, move to the next subject
              if remaining_study_hours.loc[i, 'study_hours'] == 0:
                  i += 1

      # Display the final timetable
      st.markdown(f"Weekly Study Timetable")
      timetable_rows = []
      for day, schedule in timetable.items():
          #st.markdown(f"###\n{day}:")
          for subject, hours in schedule:
              if hours != 0:
                  timetable_rows.append([day, subject, round(hours)])
                  #st.write(f"  {subject}: {round(hours)} hour(s)")
      # Create a DataFrame from the rows
      df_timetable = pd.DataFrame(timetable_rows, columns=['Day', 'Subject', 'Hours'])
      st.write(df_timetable)





